import React from "react";
import OrderShedule from "./OrderShedule";

const MainApp = (props) => {
    let a = {
        "froms": 'dfdfddf',
        "to": 'fdffdfsfdssdfsdf',
        "date": '08.20.30',
        "price": '123.3'
    }

    return (
        <div>
            <h3>Мои заказы</h3>
            <div>
                <OrderShedule props={a}/>
            </div>
        </div>
    )
}

export default MainApp;
